import React, { useState } from "react";
import "./index.css";

import Modal from "./modal";

const MyModal = ({
  visible,
  tabState,
  children,
  setTabState,
  titleText,
  width,
}) => {
  return (
    <div className={visible ? "modalopen" : "modalclosed"}>
      <Modal width={width} titleText={titleText}>
        {children} f guh {tabState}
      </Modal>
    </div>
  );
};

export default MyModal;
